import React, { Component } from 'react';
import data from "./data"; 
import "../stylesheets/Banner.css"

const currentUser = data.current_user;

class Banner extends Component {
    render() {
        return (
            <p>{currentUser.name}</p>
        );
    }
}

export default Banner;
